INSERT INTO `movie` VALUES (1000,'ZORRO ARK','A Intrepid Panorama of a Mad Scientist And a Boy who must Redeem a Boy in A Monastery',2006,50,'NC-17','2006-02-13 22:00:00','https://upload.wikimedia.org/wikipedia/en/5/52/Mask_of_zorro.jpg','https://www.youtube.com/watch?v=abwtRFZx8Rs'),(1002,'DESPICABLE ME 4!','Gru and his family enter a witness protection program after facing a new threat from the villain Maxime Le Mal and his partner Valentina. Alongside the Minions and Gru Jr., the family tries to stay hidden while dealing with enemies and family hijinks!!',2009,140,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/e/ed/Despicable_Me_4_Theatrical_Release_Poster.jpeg','https://youtu.be/QvdPxmmGcFI'),(1015,'SNOW WHITE','a beautiful princess who is pursued by her evil stepmother, the Queen, due to her great beauty. Snow White finds refuge in the home of seven dwarfs in the forest, but the Queen tries to poison her with a poisoned apple. Eventually, Snow White awakens from a kiss of true love by a prince and begins a new life.',1937,99,'R','2024-09-23 21:00:00','https://upload.wikimedia.org/wikipedia/en/4/49/Snow_White_1937_poster.png','https://www.youtube.com/watch?v=L16P0rip9E4'),(1016,'CINDERELLA 1 !','a young girl living under the oppression of her wicked stepmother and stepsisters. With the help of a fairy godmother, she attends a royal ball and meets the prince of her dreams. Despite the challenges, true love prevails as the prince finds her through the magical glass slipper.',1950,70,'G','2024-09-23 21:00:00','https://upload.wikimedia.org/wikipedia/ru/thumb/7/73/Cindyposter.jpg/323px-Cindyposter.jpg','https://www.youtube.com/watch?v=UcjYD91YW_M&t=9s'),(1017,'BEAUTY AND THE BEAST','Belle, a young woman who becomes a prisoner in a mysterious castle. There, she befriends the enchanted staff and learns to look beyond the Beast’s exterior to recognize his true heart. Through love and bravery, Belle breaks the curse, transforming the Beast and his 