nglebook_movieposter.jpg','https://www.youtube.com/watch?v=xFdtyGoVSDE'),(1029,'THE ARISTOCATS ','A pampered cat and her kittens are abandoned and must find their way back home with the help of an alley cat named Thomas O\'Malley in this charming adventure.\n\n',1970,78,'PG-13','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/8/8d/Aristoposter.jpg','https://www.youtube.com/watch?v=h6M_OJ41NfA'),(1030,'ROBIN HOOD ','In this retelling of the classic tale, Robin Hood, a clever fox, leads a band of outlaws to rob from the rich and give to the poor, all while evading the villainous Sheriff of Nottingham.\n\n',1973,83,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/9/91/Robinhood_1973_poster.png','https://upload.wikimedia.org/wikipedia/en/9/91/Robinhood_1973_poster.png'),(1031,'THE MANY ADVENTURES OF WINNIE THE POOH','A compilation of stories featuring Winnie the Pooh and his friends in the Hundred Acre Wood, as they embark on delightful adventures and solve charming problems.\n\n',1977,74,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/c/c2/The_Many_Adventures_of_Winnie_the_Pooh_poster.jpg','https://www.youtube.com/watch?v=QbFz--GCkOM'),(1032,'THE RESCUERS','Two brave mice, Bernard and Miss Bianca, set out on a daring mission to rescue a young girl kidnapped by an evil woman named Madame Medusa.\n\n',1977,78,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/a/ac/Rescuersposter.jpg','https://www.youtube.com/watch?v=x1A5azWCLDI'),(1033,'THE FOX AND THE HOUND','The story of a fox named Tod and a hound dog named Copper, whose friendship is tested as they grow older and face the realities of their natural instincts and societal expectations.\n\n',1981,83,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/7/70/The_Fox_and_the_Hound.jpg','https://www.youtube.com/watch?v=obbTbAQMaqk'),(1034,'THE BLACK CAULDRON','Young pig-keeper Taran embarks on a quest to prevent an evil warlord from using a magical cauldron to conquer the world, with the help of a group of unlikely allies.\n\n',1985,79,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/0/0a/The_Black_Cauldron_poster.jpg','https://www.youtube.com/watch?v=5roWlRne7lc'),(1035,'THE LITTLE MERMAID','Ariel, a mermaid princess, trades her voice for human legs to pursue her love for Prince Eric, facing challenges and adventures in her quest for true love.\n\n',1989,83,'PG-13','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/c/c0/The_Little_Mermaid_%28Official_1989_Film_Poster%29.png','https://www.youtube.com/watch?v=Oz0H4UHd2J4'),(1036,'ALADDIN 1','Aladdin, a street-smart youth, finds a magical lamp and teams up with the Genie to win the heart of Princess Jasmine and defeat the villainous Jafar.\n\n',1992,90,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/b/bd/Aladdin_%281992_Disney_film%29_poster.jpg','https://www.youtube.com/watch?v=nFG8CeWlTTE'),(1037,'THE LION KING','Simba, a young lion prince, flees his kingdom after his father’s death but returns to reclaim his rightful place as king and restore the balance to the Circle of Life.\n\n',1994,88,'R','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/3/3d/The_Lion_King_poster.jpg','https://www.youtube.com/watch?v=UgjEj5mXLlk'),(1038,'POCAHONTAS','Pocahontas, a Native American woman, forms a bond with English settler John Smith, bridging the gap between their cultures and fostering peace amidst colonization.\n\n',1995,81,'PG-13','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/5/57/Pocahontasposter.jpg','https://www.youtube.com/watch?v=5iB82S8rHyg'),(1039,'HERCULES','Hercules, the son of Zeus, must prove himself as a true hero and reclaim his place among the gods while battling the evil Hades and discovering his own destiny.\n\n',1997,93,'PG-13','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/6/65/Hercules_%281997_film%29_poster.jpg','https://www.youtube.com/watch?v=vlblxDGoGwo'),(1040,'MULAN 1','Mulan disguises herself as a man to join the army in place of her ailing father. Through courage and determination, she helps save China and discovers her own worth.\n\n',1998,88,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/a/a3/Movie_poster_mulan.JPG','https://www.youtube.com/watch?v=HKH7_n425Ss'),(1041,'TARZAN','Tarzan, a man raised by gorillas in the jungle, discovers his human heritage when he encounters explorers and must choose between his gorilla family and the human world.',1999,88,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/4/4f/Tarzan_%281999_film%29_-_theatrical_poster.jpg','https://www.youtube.com/watch?v=up1vWOGAyUA'),(1042,'THE EMPEROR\'S NEW GROOVE','Emperor Kuzco is transformed into a llama by his scheming advisor, Yzma. With the help of a humble villager named Pacha, Kuzco must find his way back to his palace and regain his throne.\n\n',2000,78,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/6/69/Grooveposter.jpg','https://www.youtube.com/watch?v=r5tWkRmrHDA'),(1043,'ATLANTIS: THE LOST EMPIRE','Milo Thatch, a young linguist, joins an expedition to find the lost city of Atlantis. Along the way, he uncovers ancient secrets and battles against treacherous forces.\n\n',2001,95,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/d/de/Atlantis_The_Lost_Empire_poster.jpg','https://www.youtube.com/watch?v=pZXNBq1AOoc'),(1044,'LILO & STITCH','Lilo, a young Hawaiian girl, adopts a mischievous alien named Stitch. Together, they form a unique family and face various adventures, while Stitch learns about love and belonging.\n\n',2002,85,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/c/c6/LiloandStitchmovieposter.jpg','https://www.youtube.com/watch?v=-rL-0F0idYA'),(1045,'BROTHER BEAR','Kenai, a young man, is transformed into a bear as punishment for killing one. He embarks on a journey of self-discovery and learns the true meaning of brotherhood and nature.\n\n',2003,85,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/8/86/Brother_Bear_Poster.png','https://www.youtube.com/watch?v=B80VKbxZs6E'),(1046,'HOME ON THE RANGE','Three cows, determined to save their farm from foreclosure, set out to capture an infamous cattle rustler. Their adventure is filled with humor and heart.\n\n',2004,74,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/b/b9/Homerangeposter.jpg','https://www.youtube.com/watch?v=ZuTQR6xSbNM'),(1047,'CHICKEN LITTLE','Chicken Little, the town’s smallest hero, must prove that the sky is not falling when an alien invasion threatens his town. His courage and wit shine as he saves the day.\n\n',2005,81,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/a/a5/Chickenlittlemcgiposter.jpg','https://www.youtube.com/watch?v=VUBFCaWiQ28'),(1048,'MEET THE ROBINSONS','Lewis, a young inventor, meets a quirky family from the future and learns about the importance of family, perseverance, and following his dreams.\n\n',2007,95,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/d/dc/Meet_the_robinsons.jpg','https://www.youtube.com/watch?v=3EWQ4tNm-6s'),(1049,'BOLT','Bolt, a dog who believes he has superpowers, escapes from his Hollywood life to find his owner. Along the way, he discovers the true meaning of friendship and bravery.\n\n',2008,96,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/4/44/Bolt_ver2.jpg','https://www.youtube.com/watch?v=Pj0a7GkMH3w'),(1050,'THE PRINCESS AND THE FROG','Tiana, a hardworking waitress, kisses a frog prince and is transformed into a frog herself. She must break the spell with true love’s kiss and discover her own dreams.\n\n',2009,97,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/8/81/The_Princess_and_the_Frog_poster.jpg','https://www.youtube.com/watch?v=uQBy6jqbmlU'),(1051,'TANGLED','Rapunzel, a princess with magica