ikipedia/en/2/26/Moana_Teaser_Poster.jpg','https://www.youtube.com/watch?v=LKFuXETZUsI'),(1057,'RAYA AND THE LAST DRAGON','Raya, a skilled warrior, sets out to find the last dragon, Sisu, to unite her fractured kingdom and save it from an ancient evil threatening the land.\n\n',2021,107,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/e/ea/Raya_and_the_Last_Dragon.png','https://www.youtube.com/watch?v=1VIZ89FEjYI'),(1058,'THE HUNCHBACK OF NOTRE DAME','Quasimodo, a kind-hearted hunchback living in the bell tower of Notre Dame Cathedral, befriends the beautiful gypsy Esmeralda and fights against the evil Judge Frollo to save his city.',1996,91,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/2/26/The_Hunchback_of_Notre_Dame_1996_poster.jpg','https://www.youtube.com/watch?v=O6i3lyx1I_g'),(1059,'THE RESCUERS DOWN UNDER','Bernard and Miss Bianca, two brave mice, travel to Australia to rescue a boy kidnapped by a ruthless poacher and save a rare golden eagle.',1990,77,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/0/05/Rescuersduposter.jpg','https://www.youtube.com/watch?v=DZ1Yv9oIiK4'),(1060,'OLIVER & COMPANY',' A stray kitten named Oliver joins a gang of street-smart dogs to survive in New York City, forming a strong bond with a little girl along the way.',1988,74,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/f/fd/Oliver_poster.jpg','https://www.youtube.com/watch?v=EExIKWcqSAI'),(1061,'THE GREAT MOUSE DETECTIVE','Basil of Baker Street, a mouse detective, embarks on a mission to stop the villainous Ratigan from overthrowing the Queen of England.',1986,74,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/a/a4/Mousedetectposter.jpg','https://www.youtube.com/watch?v=MY7Fch-Q-IU'),(1062,'THE ADVENTURES OF ICHABOD AND MR. TOAD','This anthology film includes two classic stories: \"The Wind in the Willows,\" featuring Mr. Toad\'s wild adventures, and \"The Legend of Sleepy Hollow,\" following Ichabod Crane and the Headless Horseman.',1949,68,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/7/77/Ichabodposter.jpg','https://www.youtube.com/watch?v=Ju_BnpsfznA'),(1063,'THE THREE CABALLEROS','Donald Duck joins two Latin American friends, José Carioca and Panchito, on a musical journey through Brazil and Mexico in this vibrant animated adventure.',1944,71,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/7/7b/Three_caballeros_poster.png','https://www.youtube.com/watch?v=tKO0T_1rL48'),(1064,'MAKE MINE MUSIC','A collection of animated musical segments set to various genres of music, including jazz, classical, and folk, showcasing Disney\'s artistic and musical creativity.',1946,75,'PG','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/7/7d/Make_mine_music_poster.png','https://www.youtube.com/watch?v=1D9JzQnvb8g&list=PLwpSpfHzxqmWGp1DAeyY5CDZ9sPen2hAU'),(1065,'MELODY TIME','Similar to Make Mine Music, this anthology film features animated shorts set to popular and classical music pieces, with stories ranging from folklore to fantasy.',1948,75,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/2/26/Melody_Time_poster.jpg','https://www.youtube.com/watch?v=BjgrjB_8vdg'),(1066,'FUN AND FANCY FREE',' This film features two stories: \"Bongo,\" about a circus bear escaping to the wild, and \"Mickey and the Beanstalk,\" a retelling of Jack and the Beanstalk with Mickey Mouse, Donald Duck, and Goofy.',1947,73,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/b/b4/Funfanposter.jpg','https://www.youtube.com/watch?v=sx4rSRHeJc0'),(1067,'SALUDOS AMIGOS','A series of four animated segments set in Latin America, with Donald Duck and Goofy on cultural adventures, showcasing the region\'s art and music.',1940,42,'G','2024-09-19 23:32:13','https://upload.wikimedia.org/wikipedia/en/a/af/Saludosposter.jpg','https://www.youtube.com/watch?v=5tTxKqaPxKM');
